    false,nt"url": null,nt"notes": "Marine Bird Specimen and Feeding Studies
    (F031) is one of a group ofnseven datasets related to Marine Birds from Coastal
    Alaska and PugetnSound Data (1975 -1980). Each dataset uses the NODC Taxonomic Code
    tonindicate species.nnMarine Bird Specimen and Feeding Studies (F031) contains data
    fromnlaboratory examination of marine bird specimens collected in the fieldnand
    analysis of food sample contents to determine prey species andncharacteristics.
    These data provide information on population dynamicsnand trophic relationships.
    Position, date and time are reported for eachnsample station, along with environmental
    data at the sample sitenincluding ice conditions, if appropriate. Environmental
    data may includenair temperature and pressure, wind direction and speed, sea surfacentemperature,
    tide conditions and habitat and microenvironmentndescriptors. Species identification,
    general biological condition (e.g.,nage, sex, color), weight, and body dimensions
    are reported for eachnspecimen (multiple specimens may be collected at each sample
    site). Ifnfood samples are taken, food sample source and characteristics arenreported.
    From food sample analysis, prey species are identified and forneach such species
    further detailed data may be presented includingnfrequency distribution of prey
    or prey part length and weight. Thesendata were collected in 1975 - 1980 for coastal
    Alaska.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
